import React from "react";
import { View, Text, StyleSheet, TextInput } from "react-native";

const LoginScreen = (props) => {
  return (
    <View>
      <Text>Login to your profile</Text>
      <TextInput />
    </View>
  );
};

export default LoginScreen;
